                            borderWidth: 2.4,
                            pointRadius: 0,
                            fill: false,
                            tension: 0.1,
                            z: 2
                        },
                        { 
                            label: 'Forecast2', 
                            data: originalData3, 
                            borderColor: '#00cc00',
                            borderWidth: 2.4,
                            pointRadius: 0,
                            fill: false,
                            tension: 0.1,
                            z: 1
                        }
                    ]
                },
                options: {
                    responsive: true,
                    scales: {
                        y: { 
                            beginAtZero: true,
                            title: { display: true, text: 'Values' },
                            grid: { color: '#999999' }
                        },
                        x: { 
                            type: 'time',
                            time: { 
                                unit: 'hour',
                                displayFormats: { hour: 'MMM D, HH:mm' }
                            },
                            title: { display: true, text: 'Date/Time' },
                            grid: { color: '#999999' }
                        }
                    },
                    plugins: {
                        zoom: {
                            pan: {
                                enabled: true,
                                mode: 'x'
                            },
                            zoom: {
                                wheel: {
                                    enabled: true,
                                    speed: 0.1
                                },
                                pinch: {
                                    enabled: true
                                },
                                mode: 'x'
                            }
                        }
                    }
                }
            });

            function filterData(period) {
                currentFilter = period;
                currentPage = 0;
                isPaginated = false;
                customDateFrom = null;
                customDateTo = null;
                updateChart();
            }

            function updateDateRange() {
                const fromInput = document.getElementById('dateFrom').value;
                const toInput = document.getElementById('dateTo').value;
                
                if (fromInput && toInput) {
                    customDateFrom = new Date(fromInput + 'T00:00:00');
                    customDateTo = new Date(toInput + 'T23:00:00');
                    currentFilter = 'custom';
                    currentPage = 0;
                    isPaginated = false;
                    updateChart();
                }
            }

            function updateChart() {
                let filteredLabels = [...originalLabels];
                let filteredData1 = [...originalData1];
                let filteredData2 = [...originalData2];
                let filteredData3 = [...originalData3];

                if (currentFilter === 'custom' && customDateFrom && customDateTo) {
                    const filteredIndices = dates.map((date, index) => 
                        date >= customDateFrom && date <= customDateTo ? index : -1
                    ).filter(index => index !== -1);

                    filteredLabels = filteredIndices.map(i => originalLabels[i]);
                    filteredData1 = filteredIndices.map(i => originalData1[i]);
                    filteredData2 = filteredIndices.map(i => originalData2[i]);
                    filteredData3 = filteredIndices.map(i => originalData3[i]);
                } else if (currentFilter !== 'all') {
                    let cutoffDate;
                    switch(currentFilter) {
                        case '30days':
                            cutoffDate = new Date(maxDate - 30 * 24 * 60 * 60 * 1000);
                            break;
                        case '7days':
                            cutoffDate = new Date(maxDate - 7 * 24 * 60 * 60 * 1000);
                            break;
                        case '24hours':
                            cutoffDate = new Date(maxDate - 24 * 60 * 60 * 1000);
                            break;
                    }
                    const filteredIndices = dates.map((date, index) => 
                        date >= cutoffDate ? index : -1
                    ).filter(index => index !== -1);

                    filteredLabels = filteredIndices.map(i => originalLabels[i]);
                    filteredData1 = filteredIndices.map(i => originalData1[i]);
                    filteredData2 = filteredIndices.map(i => originalData2[i]);
                    filteredData3 = filteredIndices.map(i => originalData3[i]);
                }

                // Apply pagination only when using Previous/Next
                if (isPaginated && currentFilter === 'all') {
                    const start = currentPage * pageSize;
                    const end = start + pageSize;
                    chart.data.labels = filteredLabels.slice(start, end);
                    chart.data.datasets[0].data = filteredData1.slice(start, end);
                    chart.data.datasets[1].data = filteredData2.slice(start, end);
                    chart.data.datasets[2].data = filteredData3.slice(start, end);
                } else {
                    chart.data.labels = filteredLabels;
                    chart.data.datasets[0].data = filteredData1;
                    chart.data.datasets[1].data = filteredData2;
                    chart.data.datasets[2].data = filteredData3;
                }
                chart.update();
            }

            function prevPage() {
                if (currentFilter === 'all') {
                    isPaginated = true;
                    if (currentPage > 0) {
                        currentPage--;
                        updateChart();
                    }
                }
            }

            function nextPage() {
                if (currentFilter === 'all') {
                    isPaginated = true;
                    const totalPages = Math.ceil(originalLabels.length / pageSize);
                    if (currentPage < totalPages - 1) {
                        currentPage++;
                        updateChart();
                    }
                }
            }

            function updatePageSize() {
                pageSize = parseInt(document.getElementById('pageSize').value);
                currentPage = 0;
                if (currentFilter === 'all' && isPaginated) {
                    updateChart();
                }
            }

            function resetZoom() {
                currentFilter = 'all';
                currentPage = 0;
                isPaginated = false;
                customDateFrom = null;
                customDateTo = null;
                document.getElementById('dateFrom').value = new Date(minDate).toISOString().split('T')[0];
                document.getElementById('dateTo').value = new Date(maxDate).toISOString().split('T')[0];
                chart.resetZoom();
                updateChart();
            }

            // Initial render - show all data
            currentFilter = 'all';
            isPaginated = false;
            updateChart();
        } catch (error) {
            document.getElementById('error').innerText = 'Error rendering chart: ' + error.message;
            console.error(error);
        }
    </script>
</body>
</html>
